import React, { useState } from "react";
// import Cards from "./Cards";
import "./App.css";
// import Sdata from "./Sdata";

const state = useState();

console.log(state);


let count = 1;

const IncNum = () => {
  console.log("clicked " + count++);
  count++;
};

function App() {
  return (
    <>
      <h1>{count}</h1>
      <button onClick={IncNum}>Click Me!</button>
    </>
  );
}

export default App;
